function Card(props){
  // console.log(props);
  return(
    <div className='cards'>
        <div className='card'>
            <img src={props.t} alt = "myPic" className="card_img" />
        
        <div className="card_info">
          <span className="card_category"></span>
          <h3 className="card_title"></h3>
          <a href = "" target="_khan">
            <button>Watch Now</button>
          </a>
        </div>
    </div>
    </div>
    );
}

export default Card ;
